var prevCount = 0;
var prevIcon;
var origTitle = null;

function createIcon(index) {
  var newIcon = document.createElement("link");
  newIcon.type = "image/x-icon";
  newIcon.rel = "shortcut icon";
  newIcon.href = favicons[index];
  return newIcon;
}

function updateIcon(currCount) {
  var index = (currCount > 98) ? 99 : currCount;
  var newIcon = createIcon(index);
  if (prevIcon) {
    document.head.removeChild(prevIcon);
  }

  document.head.appendChild(newIcon);
  prevIcon = newIcon;
}

function findAncestor (el, cls) {
    while ((el = el.parentElement) && !el.classList.contains(cls));
    return el;
}

function checkForUpdate() {
  var currCount = 0;
  var inbox = document.querySelector('span[title^=Inbox]');

  var nT = findAncestor(inbox, '_n_T');
  var conductorContent = findAncestor(nT, 'conductorContent');

  if (inbox && (!conductorContent || getComputedStyle(conductorContent, null).display != "none")) {
    if (!origTitle) {
      origTitle = document.title;
    }

    var counter = inbox.parentNode.childNodes[3].childNodes[1].childNodes[0];
    if (counter) {
      try {
        currCount = parseInt(counter.nodeValue.trim());
      } catch(e) {
        console.error(e);
      }
    }

    if (isNaN(currCount)) {
      currCount = 0;
    }

    if (currCount != prevCount) {
      document.title = (currCount > 0 ? ("(" + currCount + ") ") : "") + origTitle;
      updateIcon(currCount);
      prevCount = currCount;
    }
  } else {
      origTitle = null;
      prevCount = 0;
  }
}

window.addEventListener('load', function() {
  var links = document.head.getElementsByTagName("link");
  for (var i = 0;i < links.length;i++) {
    if (links[i].rel == "icon") {
      document.head.removeChild(links[i]);
    }
  }

  prevIcon = createIcon(0);
  document.head.appendChild(prevIcon);

  setInterval(checkForUpdate, 2500);
}, false);
